import React from 'react';
import { Container } from 'react-bootstrap';
import image from '../../images/headset (4).png';
const Header3 = () => {
  return (
    <div>
      <Container className='header-1'>
           
           <div className="header-box">
               
               <p>Showcase</p>
               <p>Add more details about what's being promoted</p>
               <p>Lorem ipsum, dolor sit amet consectetur adipisicing elit. Dolorem ipsam voluptatem totam</p>
              
           </div>
           <div className="header-box">
               <img style={{width:'30%'}} src={image} alt="" srcset="" />
           </div>
           
       </Container>
    </div>
  );
}

export default Header3;
